import React, { useState, useEffect } from "react";
import "./Popular.css";
import data from "../../epicure.json";
import { ICard, IPopular } from "../../interFaces/interFaces";
import Card from "../Card/Card";
import Restaurant from "../Restaurant/Restaurant";
import { log } from "console";


const Popular: React.FC<any>= (props:object) => {
    console.log(props.kind)
    const popular: any =props.kind.filter((best: { rating: string | string[]; }) =>
    best.rating.includes("5")
  );
//     const popularDish: any = data.dishes.filter((dish) =>
//     dish.rating.includes("5")
//   );

  return (
    <>
      <div className="popular">
        <h1>popular restaurant in epicure:</h1>
        <div className="three-div">
        {props.kind.map((card:ICard)=>(
            <Card class={kind.price ? "dish" : "rest"} img={data.dishes[0].img} name={data.dishes[0].name} icons={data.dishes[0].icons} about={data.dishes[0].about} price={data.dishes[0].price} img={data.restaurant[0].img} name={data.restaurant[0].name} chef={data.restaurant[0].chef} rating={data.restaurant[0].rating}/>
        ))}
          
        </div>
        <button>
          All restaurants <img src="/image/vector.svg" alt="" />
        </button>
      </div>
    </>
  );
};

export default Popular;

